import { getUsername } from "../LocalStorage/LocalStorage";
import "./Navbar.scss";

const Navbar = () => {
    const username = getUsername();

    return (
        <nav className='nav'>

            <button className='my-button sign-out'>
                Sign-Out
            </button>
            <div className="avatar">
            </div>
            <span className='username'>{username}</span>
        </nav>
    );
};

export default Navbar;
